import styled from "styled-components";

import { Grid } from "@material-ui/core";

export const SignInAndSignUpContainer = styled(Grid)`
  display: flex;
  justify-content: center;
  background-color: white;
  flex-wrap: wrap;
  z-index: 123;
  border-radius: 25px;
  margin-left: 11vw;
  margin-right: 11vw;
  margin-top: -33vh;
  margin-bottom: 66px;
`;
